import React, { useEffect, useState } from "react";

function Buyers(params) {
    const[buyers,setbuyers]=useState([])
    const[newbuyer,setnewbuyer]=useState([title,category,price])
    useEffect(()=>{
const configObject={
    method:"POST",
    headers:{
        "content_type":"application json",
        Accept:"applicationjson"
    },
    body:JSON.stringify(
        {
            title:newbuyer.title,
            category:newbuyer.category,
            price:newbuyer.price 
        }
    )
}
fetch("https://fakestoreapi.com/products",configObject)
.then (res=>res.json())
.then (data=>setbuyers(...buyers,data))

    },[])
    useEffect(()=>{
        fetch("https://fakestoreapi.com/products")
        .then((res)=>res.json())
        .then(data=>setbuyers(data))

    },[])
    return(
        <div>
            <form>
                 <div className="row g-3">
                    <div className="col-sm-7">
                        <input type="text" className="form-control" placeholder="City" aria-label="City"/>
                    </div>
                    <div classNames="col-sm">
                        <input type="text" className="form-control" placeholder="State" aria-label="State"/>
                    </div>
                    <div className="col-sm">
                        <input type="text" className="form-control" placeholder="Zip" aria-label="Zip"/>
                    </div>
                </div>
            </form>
            <table className="table table-bordered">
                    <thead>
                        <tr>
                        <th scope="col">#</th>
                        <th scope="col">TITLE</th>
                        <th scope="col">PRICE</th>
                        <th scope="col">CATEGORY</th>
                        </tr>
                    </thead>
            {buyers.map((buyers)=>

                    <tbody>
                        <tr>
                        <th scope="row">{buyers.id}</th>
                        <td>{buyers.title}</td>
                        <td>{buyers.price}</td>
                        <td>{buyers.category}</td>
                        </tr>
                    </tbody>

)}
 </table>
        </div>
    );
}
export default Buyers;
